            if (orderBookData.IsAmoOption.IsSet)
                if (orderBookData.IsAmoOption.Value != null)
                    writer.WriteBoolean("is_amo", orderBookData.IsAmoOption.Value!.Value);
                else
                    writer.WriteNull("is_amo");

            if (orderBookData.OrderRequestIdOption.IsSet)
                if (orderBookData.OrderRequestIdOption.Value != null)
                    writer.WriteString("order_request_id", orderBookData.OrderRequestId);
                else
                    writer.WriteNull("order_request_id");

            if (orderBookData.OrderRefIdOption.IsSet)
                if (orderBookData.OrderRefIdOption.Value != null)
                    writer.WriteString("order_ref_id", orderBookData.OrderRefId);
                else
                    writer.WriteNull("order_ref_id");
        }
    }
}
